A California law student is taking his school to court and accusing them of preventing him from continuing his education at another college over his refusal to get the Covid-19 vaccine.&nbsp;
Ryan Driggs, who is representing himself in the case, is attempting to transfer from Santa Clara University’s law school, where he is currently enrolled, reports the San Jose Mercury News.&nbsp;
Driggs accuses the school in his lawsuit of preventing him from ‘securing the economic advantages completion of his legal education would bring’ by denying him access to his transcripts.

